import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

    render() {
        return (
            <div className="App">
                <header className="App-header">

                    <a
                        className="App-link"
                        href="https://www.linkedin.com/home/?originalSubdomain=no"
                        target="_blank"
                        rel="noopener noreferrer"
                    >
                        LinkedIN
                    </a>
                </header>
            </div>
        );
    }
}

export default App;
